import React, { useEffect } from 'react';
import Container from '../components/container';

const Upload = () => {
  return (
    <Container>
      <canvas class="canvas_container jsCanvas"></canvas>
      <div class="palette">
        <input
          class="strokeWidth"
          type="range"
          id="jsRange"
          min="0.1"
          max="10"
          value="2.5"
          step="0.1"
        />
      </div>
    </Container>
  );
};

export default Upload;
